let fontIconsLoadIonIcons:() = {
    FontLoader.loadFont(IonIcon.alert.fontName(), bundleName: "Ionicons.bundle")
}()

extension IonIcon: FontEnum {

    public func fontName() ->  String{
        return "ionicons"
    }

    public func unicode() ->  String{
        return ioUnicodeMap[self] ?? ""
    }

    public func error() ->  String{
        return "Font: \(fontName()).ttf was NOT found!"
    }

    public func loadFontIfNeeded(){
        fontIconsLoadIonIcons
    }

    public func allValues() ->  [IonIcon]{
        let keys = Array(ioUnicodeMap.keys)
        return keys
    }
}
